Suite *scp_mult_matrix_tests(void) {
  Suite *s1 = suite_create(PRE_TEST_HEADER "SCP_MULT" POST_TEST_HEADER);
  TCase *tc1_1 = tcase_create("SCP_MULT");

  suite_add_tcase(s1, tc1_1);
  tcase_add_test(tc1_1, scp_mult_0);
  tcase_add_test(tc1_1, scp_mult_1);
  tcase_add_test(tc1_1, scp_mult_2);
  tcase_add_test(tc1_1, scp_mult_3);
  tcase_add_test(tc1_1, scp_mult_4);
  tcase_add_test(tc1_1, scp_mult_5);
  tcase_add_test(tc1_1, scp_mult_6);
  tcase_add_test(tc1_1, scp_mult_7);
  tcase_add_test(tc1_1, scp_mult_8);
  tcase_add_test(tc1_1, scp_mult_9);
  tcase_add_test(tc1_1, scp_mult_10);
  tcase_add_test(tc1_1, scp_mult_11);
  tcase_add_test(tc1_1, scp_mult_12);

  return s1;
}
